def f_gold(nums: List[int], maximumBit: int) -> List[int]:
    n = len(nums)
    s = [0] * (n + 1)
    for i, x in enumerate(nums):
        s[i + 1] = s[i] ^ x
    ans = []
    for x in s[:0:-1]:
